description:
Verenigde Staten
Komedie / Romantiek
106 minuten

goed

met Jennifer Lopez, Alex O'Loughlin en Eric Christian Olsen

Zoe (Jennifer Lopez) wil graag moeder worden en is van mening dat het veel te lang duurt om op een juiste man als vader te 
wachten. Ze besluit zich kunstmatig te laten bevruchten. Juist op de grote dag ontmoet ze ene Stan (Alex O'Loughlin), een man 
die wel eens de ware zou kunnen zijn. Om hem niet af te schrikken besluit ze haar zwangerschap geheim te houden.
